import axios from "axios"




const API_KEY = "441b46165ac2d0aea117cda3d2fae79b"
const URL = "https://api.openweathermap.org/data/2.5/weather"

export const Fetch = async (Query) => {
    let { data } = await axios.get(URL, {
        params: {
            q: Query,
            units: "metric",
            AppID: API_KEY
        }
    })
    return data
}
